  \"Development of Ecological Reference Models and an Assessment Framework for Streams
  on the Atlantic Coastal Plain\",\n\t\"tracking_summary\": {\n\t\t\"total\": 2,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:05:19.281201\",\n\t\"name\": \"development-of-ecological-reference-models-and-an-assessment-framework-for-streams-on-the-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Military installations in the Sand Hills
  ecoregion of the Atlantic Coastal Plain protect unique ecosystems including blackwater
  streams. The Department of Defense is committed to the recovery of degraded ecosystems
  but lacks reference models that specify end-states representative of least disturbed
  conditions. This project developed ecological reference models and assessment frameworks
  for evaluating the ecological integrity of coastal plain streams. The models were
  based on biological, habitat, and watershed data collected from undeveloped areas
  within major DoD installations and other protected lands. Ecological reference models
  were developed for fish communities, macroinvertebrate communities, and stream hydrogeomorphic
  conditions. The models provided a basis for multimetric indices, predictive models,
  and other assessment frameworks that measured deviations from reference model objectives.
  Habitat data were analyzed to interpret biological responses and identify factors
  that could affect recovery success. Performance evaluations indicated that most
  methods performed well at highly disturbed sites and that the concomitant use of
  fish and macroinvertebrate methods resulted in greater ability to detect degradation.
  The assessment frameworks provide tools that can be used to monitor the ecological
  health of wadeable streams and assess their recovery to reference states characteristic
  of least disturbed conditions or best attainable conditions imposed by factors that
  limit recovery.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
